import React from 'react'
import "../Game.css"

const GameCircle = ({id,children,onCircleClicked}) => {

  return (
    <div className={`gameCircle player_0`} onClick={()=>onCircleClicked(id)}>
      {children}
    </div>
  )
}

export default GameCircle
